import { Component } from "react";
import "./style.css";

class LerInput extends Component{

}

class Entrada extends Component {
  render() {
    return (
      <section className="entrada-container">
        <div className="entrada-wrap">
          <h1 className="entrada-titulo">To Do List</h1>
          <div>
            <input className="entrada-input" type="text" onChange={LerInput}/>
            <button className="entrada-adiciona" type="button">
              Adicionar
            </button>
          </div>
        </div>
      </section>
    );
  }
}

export default Entrada;
